script: |
  super -f text -I q10753.spq | sort > q10753.out

inputs:
  - name: q10753.spq
    data: |
      SELECT DISTINCT - 33, + col1 + - col1 + - ( + col2 ) AS col2 FROM tab0 (FORMAT parquet) AS cor0;
  - name: tab0

outputs:
  - name: q10753.out
    data: |
      -33	-10
      -33	-47
      -33	-99
